<input  type="radio" onmouseover="check()" class="button">
<script>
var classnumber = 0;
var style = 'fill';
var color;
var erase = 0;
function key(){
var keyid = event.key;
if(keyid == 1){
style = 'fill';}
else if(keyid == 2){
style = 'skip';}
else if(keyid == 3){
style = 'skiptwo';}
else if(keyid == 4){
style = 'skipline';}
else if(keyid == 5){
color = setInterval(check, 20)}
else if(keyid == 6){
while(erase < 5250){
document.getElementsByClassName('button')[erase].checked = false;
erase++;}
erase = 0;
classnumber = 0;
clearInterval(color);}}

function check(){
if(classnumber < 5250){
if(style == 'fill'){
document.getElementsByClassName('button')[classnumber].checked = true;
classnumber++;}
else if(style == 'skip'){
document.getElementsByClassName('button')[classnumber].checked = true;
classnumber += 2;}
else if(style == 'skiptwo'){
document.getElementsByClassName('button')[classnumber].checked = true;
classnumber += 4;}
else if(style == "skipline"){
document.getElementsByClassName('button')[classnumber].checked = true;
classnumber += 50;
}}
else{
clearInterval(color);}}
</script>
